import './../style/main.css';
import './../style/font-awesome.min.css'
import './../style/traduler.css';
import { useEffect, useState } from "react";

const MyList = () => {
    let [toggle, setToggle] = useState(false);
    let [items, setItems] = useState([]);

    const removeMyList = (id) => {
        const newArr = items.filter((item) => item.placeId !== id );
        localStorage.setItem("watched", JSON.stringify(newArr));
        setItems(newArr);
    }

    return (
        <>
            <br /><h2>My Tradule Listüèñ</h2>
            {
                items.length > 0
                    ? items.map((item) => {
                        return (
                            <div id="replyList">
                                <span>{item.placeName}</span>
                                <img src={`http://localhost:8899/readImages/${item.image}`} /><span onClick={() => { removeMyList(item.placeId) }}>&nbsp;üíî</span><br />
                            </div>
                        )
                    })
                    : <div>None</div>
            }
        </>
    )
}

export default MyList();
